  <div id="content">

    <form id="side_panel">
      <h1>
Unemplyment Data      </h1>
      <section>
	<div id="renderer_form" class="toggler">
	  <input type="radio" name="renderer" id="area" value="area" checked>
	  <label for="area">area</label>
	  <input type="radio" name="renderer" id="bar" value="bar">
	  <label for="bar">bar</label>
	  <input type="radio" name="renderer" id="line" value="line">
	  <label for="line">line</label>
	  <input type="radio" name="renderer" id="scatter" value="scatterplot">
	  <label for="scatter">scatter</label>
	</div>
      </section>
      <section>
	<div id="offset_form">
	  <label for="stack">
	    <input type="radio" name="offset" id="stack" value="zero" checked>
	    <span>stack</span>
	  </label>
	  <label for="stream">
	    <input type="radio" name="offset" id="stream" value="wiggle">
	    <span>stream</span>
	  </label>
	  <label for="pct">
	    <input type="radio" name="offset" id="pct" value="expand">
	    <span>pct</span>
	  </label>
	  <label for="value">
	    <input type="radio" name="offset" id="value" value="value">
	    <span>value</span>
	  </label>
	</div>
	<div id="interpolation_form">
	  <label for="cardinal">
	    <input type="radio" name="interpolation" id="cardinal" value="cardinal" checked>
	    <span>cardinal</span>
	  </label>
	  <label for="linear">
	    <input type="radio" name="interpolation" id="linear" value="linear">
	    <span>linear</span>
	  </label>
	  <label for="step">
	    <input type="radio" name="interpolation" id="step" value="step-after">
	    <span>step</span>
	  </label>
	</div>
      </section>
      <section>
	<h6>Smoothing</h6>
	<div id="smoother"></div>
      </section>
      <section><div id="legend"></div></section>
    </form>

      var val = 0;
      for (var i = 0; i < numOpts.length; i++) {
	val = val + numOpts[i]*getRadio(blueOpts[i]);
      }
      if(blue != red) {
      this.blue.series.disable();
      this.blue.element.classList.add('disabled');
      }

      this.blue = legend.lines[val];
      this.blue.series.enable();
      this.blue.element.classList.remove('disabled');
      }

      function redFunc()
      {
      var val = 0;
      for (var i = 0; i < numOpts.length; i++) {
	val = val + numOpts[i]*getRadio(redOpts[i]);
      }
      if(blue != red) {
      this.red.series.disable();
      this.red.element.classList.add('disabled');
      }

      this.red = legend.lines[val];
      this.red.series.enable();
      this.red.element.classList.remove('disabled');
      }
      
      var init = this.disableOthers();		  
			  
  </script>
